import React, { Component } from "react";

class CadastroProduto extends Component {
  constructor(props) {
    super(props);

    this.state = {
      listProducts: "",
    };
  }
  componentDidMount() {
    if (this.props.location.list) {
      console.log("ENTREI");
      let products = this.props.location.list.products;
      console.log("aa ", products);
      this.setState({
        listProducts: products,
      });
    }
  }

  render() {
    if (this.props.location.list) {
      var x = this.props.location.list.products.map((item, key) => {
        return (
          <li key={key}>
            <div className="cards-item">
              <div className="cards-item-aligment">
                <div className="style-cards"></div>
                {item.name}
                <br />
                {item.price}
              </div>
            </div>
          </li>
        );
      });
    }
    return (
      <div className="container">
        <h1>Lista de Produtos</h1>
        <div className="content">
          <ul>{x}</ul>
        </div>
      </div>
    );
  }
}
export default CadastroProduto;
